const App = () => {

  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header/>
      <Content firstName={part1} firstVal={exercises1} 
        secondName={part2} secondVal={exercises2}
        thirdName={part3} thirdVal={exercises3}/>
      <Total val={exercises1 + exercises2 + exercises3}/>
    </div>
  )
}

const Header = () => {
  const course = 'Half Stack application development'
  return (
    <div>
      <h1>{course}</h1>
    </div>
  )
}

const Content = (props) => {  
    return(
      <div>
 <p>
        {part1} {exercises1}
      </p>
      <p>
        {part2} {exercises2}
      </p>
      <p>
        {part3} {exercises3}
      </p>
      </div>
    )
}

const Total = (props) => {
  return(
    <div>
      <p>Number of exercises {props.val}</p>
    </div>
  )
}


export default App
